import React from 'react';

class SearchBar extends React.Component {
  render() {
    return (
      <div>
        <input
          type="text"
          data-testid="query-input"
          onChange={ this.getInput }
        />
        <button
          type="button"
          data-testid="query-button"
          onClick={ this.getProducts }
        >
          Search
        </button>
      </div>
    );
  }
}

export default SearchBar;
